import BurgerMenu from '../BurgerMenu';
import NavigationDesktop from '../NavigationDesktop';
import NavigationMobile from '../NavigationMobile';

const Header = () => (
  <nav>
    <NavigationDesktop />
    <BurgerMenu />
    <NavigationMobile />
  </nav>
);

export default Header;
